import { useCallback, useState, useRef } from "react";
import styled from "styled-components";
import axios from "axios";
import '/Appcss';

const Bg = styleddiv`
  width: 100%;
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  background-repeat: no-repeat;
`;

const WhiteBar = styleddiv`
  width: 650px;
  height: 620px;
  margin: 50px auto;
  background-color: white;
  border-radius: 12rem;
  align-items: center;
  justify-items: center;
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
`;
const Title = styleddiv`
  font-weight: bold;
  color: black;
  font-size: 50px;
  position: relative;
  font-family: "work sans";
  left: 225px;
`;
const IdPass = styleddiv`
  margin: 50px auto;
`;
const IdDesign = styledinput`
  color: black;
  outline: none;
  border: none;
  position: relative;
  left: 170px;
  margin: 70px 0 15px 0;
  font-family: "work sans";
  width: 300px;
  font-size: 18px;
  &::-webkit-input-placeholder {
    opacity: 1;
    transition: opacity 025s ease-out;
  }
  &:hover::-webkit-input-placeholder,
  &:focus::-webkit-input-placeholder {
    opacity: 0;
  }
`;
const Border1 = styleddiv`
  border-bottom: 3px solid #9999FF;
  width: 55%;
  position: relative;
  left: 150px;
`;

const Border2 = styleddiv`
  border-bottom: 3px solid #9999FF;
  width: 55%;
  position: relative;
  left: 150px;
`;
const PasswordDesign = styledinput`
  font-family: "work sans";
  color: black;
  outline: none;
  margin: 50px 0 15px 0;
  border: none;
  position: relative;
  left: 170px;
  width: 300px;
  font-size: 18px;
  &::-webkit-input-placeholder {
    opacity: 1;
    transition: opacity 025s ease-out;
  }
  &:hover::-webkit-input-placeholder,
  &:focus::-webkit-input-placeholder {
    opacity: 0;
  }
`;

const JoinBtn = styledbutton`
  transition: opacity 025s ease-out;
  &:hover {
    opacity: 08;
  }
  color: black;
  font-size: 11rem;
  padding-bottom: 15rem;
  margin-top: 50px;
  padding-top:25px;
  align-items: center;
  justify-content: center;
  border-radius: 1rem;
  width: 300px;
  font-family: "work sans";
  background-repeat: no-repeat;
  background-color:#9999FF;
`;

const Screen = styleddiv`
  
`;
export default function SignUp() {
  const [input1, SetInput1] = useState("");
  const [input2, SetInput2] = useState("");
  const [input3, SetInput3] = useState("");

  const Id_onchange = useCallback(
    (e) => {
      SetInput1(etargetvalue);
    },
    [input1]
  );

  const Password_onchange = useCallback(
    (e) => {
      SetInput2(etargetvalue);
    },
    [input2]
  );

  const Password_onchange_check = useCallback(
    (e) => {
      SetInput3(etargetvalue);
    },
    [input3]
  );

  // const onClick = useCallback(
  //   (e) => {
  //     if (input1 && input2 && input3) {
  //       if (input2 === input3) {
  //         let data = {
  //           "name" : input1,
  //           "password" : input2,
  //         };
  //         axios
  //           // post("/api/auth/signUp", JSONstringify(data), {
  //           //   headers: {
  //           //     "Content-Type": `application/json`,
  //           //   },
  //           // })
  //           post("/api/auth/signUp", data)
  //           then(function (response) {
  //             consolelog(response);
  //           })
  //           catch(function (error) {
  //             consolelog(error);
  //           });
  //       }
  //     } else alert("제대로 입력해주세요!");
  //     SetInput1("");
  //     SetInput2("");
  //     SetInput3("");
  //   },
  //   [input1, input2, input3]
  // );
  const onClick = async()=>{
    if (input1 && input2 && input3) {
      if (input2 === input3) {
        let data = {
          name : input1,
          password : input2,
        };
        try{
          const response= await axiospost("/api/auth/signUp", data);
           consolelog(response);
        }
        catch(e){
          consolelog(e);
        }
      }
      else alert("제대로 입력해주세요!");
      SetInput1("");
      SetInput2("");
      SetInput3("");
    }
  };
  return (
    <Screen>
      <style>{'body { background-color: #CCCCFF; }'}</style>
      <Bg>
        <WhiteBar className="fadein">
          <IdPass>
            <Title className="fadein">회원가입</Title>
            <div className="fadein">
              <IdDesign
                type="text"
                placeholder="Enter your ID"
                name="name"
                value={input1}
                onChange={Id_onchange}
              />
            </div>
            <Border1 className="fadein"/>
            <div className="fadein">
              <PasswordDesign
                type="password"
                placeholder="Enter your password"
                name="password"
                value={input2}
                onChange={Password_onchange}
              />
            </div>
            <Border2 className="fadein"/>
            <div className="fadein">
              <PasswordDesign
                type="password"
                placeholder="Check your password"
                name="password_check"
                value={input3}
                onChange={Password_onchange_check}
              />
            </div>
            <Border2 className="fadein"/>
            <JoinBtn type="submit" onClick={onClick} className="fadein">
              Sign In 
            </JoinBtn>
          </IdPass>
        </WhiteBar>
      </Bg>
    </Screen>
  );
}
